def sentence_selector(input_text,mesh_list):  
  result=''
  sentences=split_into_sentences(input_text)
  for sentence in sentences:
    status='NO'
    doc=nlp(sentence)
    for token in doc:
      if token.lemma_ in mesh_list:
        status='OK'
    if status=='OK':
      result=result+sentence
  if result=='':
    result=input_text
  return result

