def dictionaryFormation(p_key,p_value,p_dict):
  dct=p_dict
  key=p_key
  value=p_value
  dct[key]=[value]
  return dct
import re
def replace_words(s, words):
  for k, v in words.items():
    key=re.compile(k, re.IGNORECASE)
    s = key.sub(v[0],s)
  return s

